import './Events.css' 
import EventItem from '../EventItem/EventItem'

function Events(props){ 

    return(
        <div className='Events'>
            {props.data.map((item) => {
                return <EventItem title={item['event'][0]} des={title['event']}/>
            })}
        </div>
    )
} 

export default Events
